import './App.css';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Home from './component/Home';
import { UserProvider } from './component/users context/UserContext';

function App() {
  return (
    <div className="App">
      <UserProvider>
        <BrowserRouter >
          <Routes>
            <Route path="/" element={<Home />} />
            {/* <Route path="about" element={<About />} /> */}
          </Routes>
        </BrowserRouter>
      </UserProvider>
    </div>
  );
}

export default App;
